  `type` int(0) NULL DEFAULT NULL COMMENT '通知类型：\r\ntype=1 ---请假模块通知【面向具体用户】 \r\ntype=2 ---通知模块导员通知【面向班级】\r\ntype=3 ---通知模块书记通知【面向全院】\r\ntype=4 ---会议模块通知\r\ntype=5 ---奖学金模块通知',
  `subject_context` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '主题是什么',
  `file_address` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL COMMENT '附件的地址',
  `publisher_id` bigint(0) NULL DEFAULT NULL COMMENT '发布本条通知的用户的id 目前是给发布通知业务使用',
  `uuid` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT 'uuid作为本条通知唯一标识',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 527 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_0900_ai_ci ROW_FORMAT = Dynamic;

